INSERT INTO `weapons` (`id_weapons`, `name`, `description`, `atk_weapon`, `hp_weapon`, `weaponimage`) VALUES
(9, 'Ngôi Sao Cực Đông', 'Tăng 12% sát thương Kỹ Năng Nguyên Tố và Kỹ Năng Nộ gây ra; Tấn công thường, trọng kích, Kỹ Năng Nguyên Tố hoặc Kỹ Năng Nộ sau khi đánh trúng kẻ địch sẽ sản sinh 1 tầng hiệu quả \"Ngôi Sao Đêm Trắng\" trong 12s. Khi trong trạng thái \"Ngôi Sao Đêm Trắng\" tầng 1/2/3/4, sức tấn công tăng 10/20/30/48%. Hiệu quả \"Ngôi Sao Đêm Trắng\" sinh ra từ tấn công thường, trọng kích, Kỹ Năng Nguyên Tố hoặc Kỹ Năng Nộ sẽ tồn tại độc lập với nhau.', 100, 1101, '');
INSERT INTO `weapons` (`id_weapons`, `name`, `description`, `atk_weapon`, `hp_weapon`, `weaponimage`) VALUES
(10, 'Lời Thề Tự Do Cổ Xưa ', 'Một phần của \"Ca Khúc Thời Đại Nghìn Năm\" lãng du trong gió. Sát thương tạo thành tăng 10%; Khi kích hoạt phản ứng nguyên tố, nhân vật sẽ nhận 1 Lá Bùa Phấn Khởi, mỗi 0.5s tối đa kích hoạt một lần, nhân vật dự bị trong đội cũng sẽ kích hoạt. Khi có 2 Lá Bùa Phấn Khởi sẽ tiêu hao tất cả Lá Bùa Phấn Khởi, khiến tất cả nhân vật trong đội gần đó nhận được hiệu ứng \"Ca Khúc Thời Đại Nghìn Năm - Bài Ca Kháng Chiến\" trong 12s: Sát thương đánh thường, trọng kích, tấn công khi đáp tăng 16%, tấn công tăng 20%. Trong 20s sau khi kích hoạt sẽ không nhận được Lá Bùa Phấn Khởi nữa. Khi các hiệu quả của \"Ca Khúc Thời Đại Nghìn Năm\" đang kích hoạt, những hiệu quả cùng loại khác sẽ không được cộng dồn.', 110, 60, ''),
(11, 'Ánh Sáng Đêm Sương Mù', 'Tăng 12% Sát Thương Nguyên Tố, đồng thời nhận lấy sức mạnh \"Vết Cắt Sương Mù\". Khi Vết Cắt Sương Mù ở tầng 1/2/3 sẽ tăng Sát Thương Nguyên Tố cùng loại với bản thân, tương ứng là 8/16/28%. Nhân vật sẽ được nhận 1 tầng Vết Cắt Sương Mù khi: Tấn Công Thường tạo thành Sát Thương Nguyên Tố tồn tại trong 5 giây; Thi triển Kỹ Năng Nộ tồn tại trong 10 giây; Ngoài ra, Năng Lượng Nguyên Tố của nhân vật khi thấp hơn 100%, sẽ tạo ra một tầng Vết Cắt Sương Mù, Vết Cắt Sương Mù của lần này sẽ biến mất sau khi Năng Lượng Nguyên Tố của nhân vật được nạp đầy. Thời gian tồn tại của mỗi tầng Vết Cắt Sương Mù được tính độc lập với nhau.', 190, 50, '');
INSERT INTO `weapons` (`id_weapons`, `name`, `description`, `atk_weapon`, `hp_weapon`, `weaponimage`) VALUES
(12, 'Trượng Hộ Ma', 'HP tăng 20%. Ngoài ra, nhận được buff tấn công bằng 0.8% giới hạn HP của nhân vật trang bị vũ khí này. Khi HP của nhân vật trang bị vũ khí này dưới 50%, sẽ nhận thêm buff tấn công bằng 1% giới hạn HP.', 608, 500, '');
INSERT INTO `weapons` (`id_weapons`, `name`, `description`, `atk_weapon`, `hp_weapon`, `weaponimage`) VALUES
(13, 'Lạc Hà ', 'Có 3 loại trạng thái gồm Chạng Vạng, Lưu Hà, Hừng Đông, lần lượt tăng 6%/10%/14% sát thương gây ra. Khi tấn công trúng kẻ địch sẽ chuyển sang trạng thái tiếp theo, mỗi 7s tối đa chuyển trạng thái một lần. Nhân vật trang bị vũ khí này khi không ra trận cũng sẽ có thể kích hoạt chuyển đổi.', 452, 263, '');
INSERT INTO `weapons` (`id_weapons`, `name`, `description`, `atk_weapon`, `hp_weapon`, `weaponimage`) VALUES
